import './styles.css';

const Evaluation = () => {
  return (
    <div className="evaluation-container">
      <form>
        <div className="mb-4">
          <input
            type="text"
            className="form-control base-input"
            placeholder="Deixe a sua "
            name="username"
          />
        </div>
        <div className="login-submit">
          <Button text="Fazer login" />
        </div>
      </form>
    </div>
  );
};

export default Evaluation;
